import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Route} from "react-router-dom";

import './scss/app.scss';
import App from './App';


ReactDOM.render(
    <React.StrictMode>
        <BrowserRouter>
            <Route path='/' component={App}/>
        </BrowserRouter>
    </React.StrictMode>,
    document.getElementById('root')
);
